"use strict";(self.webpackChunkcasibase_website=self.webpackChunkcasibase_website||[]).push([[1045],{2190:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/casibase-deepSeek-guideline","metadata":{"permalink":"/zh/blog/casibase-deepSeek-guideline","editUrl":"https://github.com/casibase/casibase-website/edit/master/i18n/zh/docusaurus-plugin-content-blog/casibase-deepSeek-guideline.md","source":"@site/i18n/zh/docusaurus-plugin-content-blog/casibase-deepSeek-guideline.md","title":"Casibase + DeepSeek \u96c6\u6210\u6307\u5357","description":"\u5728\u5f53\u4eca\u6570\u5b57\u65f6\u4ee3\uff0c\u4f01\u4e1a\u548c\u4e2a\u4eba\u5bf9\u9ad8\u6548\u7684\u77e5\u8bc6\u7ba1\u7406\u548c\u667a\u80fd\u95ee\u7b54\u7cfb\u7edf\u7684\u9700\u6c42\u65e5\u76ca\u589e\u957f\u3002\u968f\u7740\u4eba\u5de5\u667a\u80fd\u6280\u672f\u7684\u5feb\u901f\u53d1\u5c55\uff0c\u4eba\u4eec\u6b63\u5728\u5bfb\u6c42\u66f4\u667a\u80fd\u3001\u66f4\u9ad8\u6548\u7684\u89e3\u51b3\u65b9\u6848\u6765\u6539\u8fdb\u4fe1\u606f\u5904\u7406\u3001\u4f18\u5316\u5de5\u4f5c\u6d41\u7a0b\u5e76\u63d0\u5347\u7528\u6237\u4f53\u9a8c\u3002 \u968f\u7740\u4eba\u5de5\u667a\u80fd\u6280\u672f\u7684\u5feb\u901f\u53d1\u5c55\uff0c\u4eba\u4eec\u6b63\u5728\u5bfb\u627e\u66f4\u667a\u80fd\u3001\u66f4\u9ad8\u6548\u7684\u89e3\u51b3\u65b9\u6848\uff0c\u4ee5\u6539\u5584\u4fe1\u606f\u5904\u7406\u3001\u4f18\u5316\u5de5\u4f5c\u6d41\u7a0b\u5e76\u63d0\u5347\u7528\u6237\u4f53\u9a8c\u3002","date":"2025-06-10T16:06:53.100Z","formattedDate":"2025\u5e746\u670810\u65e5","tags":[{"label":"Casibase","permalink":"/zh/blog/tags/casibase"}],"readingTime":8.205,"hasTruncateMarker":false,"authors":[{"name":"Casibase \u56e2\u961f","url":"https://github.com/casibase","imageURL":"https://avatars.githubusercontent.com/casibase"}],"frontMatter":{"title":"Casibase + DeepSeek \u96c6\u6210\u6307\u5357","author":"Casibase \u56e2\u961f","author_url":"https://github.com/casibase","author_image_url":"https://avatars.githubusercontent.com/casibase","tags":["Casibase"]},"nextItem":{"title":"\u6b22\u8fce","permalink":"/zh/blog/welcome"}},"content":"\u5728\u5f53\u4eca\u6570\u5b57\u65f6\u4ee3\uff0c\u4f01\u4e1a\u548c\u4e2a\u4eba\u5bf9\u9ad8\u6548\u7684\u77e5\u8bc6\u7ba1\u7406\u548c\u667a\u80fd\u95ee\u7b54\u7cfb\u7edf\u7684\u9700\u6c42\u65e5\u76ca\u589e\u957f\u3002\u968f\u7740\u4eba\u5de5\u667a\u80fd\u6280\u672f\u7684\u5feb\u901f\u53d1\u5c55\uff0c\u4eba\u4eec\u6b63\u5728\u5bfb\u6c42\u66f4\u667a\u80fd\u3001\u66f4\u9ad8\u6548\u7684\u89e3\u51b3\u65b9\u6848\u6765\u6539\u8fdb\u4fe1\u606f\u5904\u7406\u3001\u4f18\u5316\u5de5\u4f5c\u6d41\u7a0b\u5e76\u63d0\u5347\u7528\u6237\u4f53\u9a8c\u3002 \u968f\u7740\u4eba\u5de5\u667a\u80fd\u6280\u672f\u7684\u5feb\u901f\u53d1\u5c55\uff0c\u4eba\u4eec\u6b63\u5728\u5bfb\u627e\u66f4\u667a\u80fd\u3001\u66f4\u9ad8\u6548\u7684\u89e3\u51b3\u65b9\u6848\uff0c\u4ee5\u6539\u5584\u4fe1\u606f\u5904\u7406\u3001\u4f18\u5316\u5de5\u4f5c\u6d41\u7a0b\u5e76\u63d0\u5347\u7528\u6237\u4f53\u9a8c\u3002\\n\\nCasibase \u4f5c\u4e3a\u4e00\u4e2a\u5f00\u6e90\u7684 AI \u77e5\u8bc6\u5e93\u548c\u5bf9\u8bdd\u7cfb\u7edf\uff0c\u56e0\u5176\u5f3a\u5927\u7684\u591a\u6a21\u578b\u517c\u5bb9\u6027\u3001\u4f01\u4e1a\u7ea7\u529f\u80fd\u652f\u6301\u4ee5\u53ca\u76f4\u89c2\u53cb\u597d\u7684 Web \u754c\u9762\uff0c\u5df2\u6210\u4e3a\u8bb8\u591a\u5f00\u53d1\u8005\u548c\u4f01\u4e1a\u7684\u9996\u9009\u89e3\u51b3\u65b9\u6848\u3002\u5b83\u4e0d\u4ec5\u80fd\u591f\u9ad8\u6548\u5730\u7ec4\u7ec7\u548c\u68c0\u7d22\u77e5\u8bc6\uff0c\u8fd8\u63d0\u4f9b\u7075\u6d3b\u7684\u63a5\u53e3\uff0c\u53ef\u4ee5\u8f7b\u677e\u96c6\u6210\u5404\u79cd AI \u6a21\u578b\uff0c\u4ee5\u6ee1\u8db3\u4e0d\u540c\u573a\u666f\u7684\u9700\u6c42\u3002\\n\\n\u540c\u65f6\uff0c\u6700\u8fd1\u53d1\u5e03\u7684\u5148\u8fdb AI \u6a21\u578b\u5982 **DeepSeek R1** \u56e0\u5176\u51fa\u8272\u7684\u6027\u80fd\u3001\u4f18\u5316\u7684\u84b8\u998f\u6280\u672f\u548c\u514d\u8d39\u5f00\u6e90\u7b49\u7279\u70b9\uff0c\u5728\u5f00\u53d1\u8005\u793e\u533a\u5f15\u8d77\u4e86\u5e7f\u6cdb\u5173\u6ce8\u3002DeepSeek R1 \u5f3a\u5927\u7684\u63a8\u7406\u80fd\u529b\u548c\u9ad8\u6548\u7684\u77e5\u8bc6\u6574\u5408\u80fd\u529b\u4f7f\u5176\u5728\u667a\u80fd\u95ee\u7b54\u3001\u4ee3\u7801\u751f\u6210\u3001\u6587\u672c\u7406\u89e3\u7b49\u4efb\u52a1\u4e2d\u8868\u73b0\u51fa\u8272\uff0c\u6210\u4e3a\u5f00\u6e90 AI \u751f\u6001\u7cfb\u7edf\u4e2d\u7684\u91cd\u8981\u4e00\u5458\u3002\\n\\n\u5728\u672c\u6587\u4e2d\uff0c\u6211\u4eec\u5c06\u8ba8\u8bba\u5982\u4f55\u9ad8\u6548\u5730\u5c06 Casibase \u4e0e DeepSeek R1 \u96c6\u6210\uff0c\u6784\u5efa\u4e00\u4e2a\u5177\u6709\u9ad8\u6027\u80fd\u3001\u5b89\u5168\u6027\u548c\u5f3a\u5927\u529f\u80fd\u7684 AI \u77e5\u8bc6\u5e93\u548c\u5bf9\u8bdd\u7cfb\u7edf\u3002\u6211\u4eec\u5c06\u4ecb\u7ecd\u4ece\u73af\u5883\u642d\u5efa\u5230\u5b9e\u9645\u5e94\u7528\u7684\u5173\u952e\u6b65\u9aa4\uff0c\u5e76\u5206\u6790\u5982\u4f55\u5229\u7528 Casibase \u7684\u4f01\u4e1a\u7ea7\u529f\u80fd\u548c DeepSeek R1 \u7684\u5f3a\u5927\u80fd\u529b\u6765\u5b9e\u73b0\u51c6\u786e\u9ad8\u6548\u7684\u667a\u80fd\u95ee\u7b54\u548c\u77e5\u8bc6\u7ba1\u7406\u3002\\n\\n## \u4ec0\u4e48\u662f Casibase\uff1a\\n\\nCasibase \u662f\u4e00\u4e2a\u5f00\u6e90\u7684 AI \u77e5\u8bc6\u5e93\u548c\u5bf9\u8bdd\u7cfb\u7edf\uff0c\u5b83\u7ed3\u5408\u4e86\u6700\u65b0\u7684 RAG\uff08\u68c0\u7d22\u589e\u5f3a\u751f\u6210\uff09\u6280\u672f\u3001\u4f01\u4e1a\u7ea7\u5355\u70b9\u767b\u5f55\uff08SSO\uff09\u529f\u80fd\uff0c\u5e76\u652f\u6301\u5e7f\u6cdb\u7684\u4e3b\u6d41 AI \u6a21\u578b\u3002\u4f5c\u4e3a\u4e00\u4e2a\u7c7b\u4f3c LangChain \u7684\u7cfb\u7edf\uff0cCasibase \u65e8\u5728\u4e3a\u4f01\u4e1a\u548c\u5f00\u53d1\u8005\u63d0\u4f9b\u4e00\u4e2a\u5f3a\u5927\u3001\u7075\u6d3b\u4e14\u6613\u7528\u7684\u77e5\u8bc6\u7ba1\u7406\u548c\u667a\u80fd\u5bf9\u8bdd\u5e73\u53f0\u3002\\n\\n\u76ee\u524d\uff0cCasibase \u652f\u6301\u57fa\u4e8e OpenAI \u7684 GPT \u7cfb\u5217\u3001Gemini\u3001Claude\u3001Moonshot\u3001DeepSeek \u7b49\u8bed\u8a00\u6a21\u578b\uff0c\u4ee5\u53ca\u57fa\u4e8e OpenAI \u7684\u5d4c\u5165\u6a21\u578b\u3001Hugging Face \u7684 sentence-transformers\u3001Cohere\u3001Qwen \u7b49\u5d4c\u5165\u6a21\u578b\u3002\u8fd9\u79cd\u5e7f\u6cdb\u7684\u6a21\u578b\u652f\u6301\u4f7f\u7528\u6237\u80fd\u591f\u6839\u636e\u9700\u6c42\u548c\u504f\u597d\u9009\u62e9\u6700\u9002\u5408\u7684 AI \u6a21\u578b\uff0c\u540c\u65f6\u4e5f\u65b9\u4fbf\u672a\u6765\u96c6\u6210\u65b0\u7684\u6a21\u578b\u3002\\n\\n### Casibase \u5728\u7ebf\u6f14\u793a\uff1a\\n\\nCasibase \u63d0\u4f9b\u4e86\u591a\u4e2a\u5728\u7ebf\u6f14\u793a\u7ad9\u70b9\uff0c\u5305\u62ec\u804a\u5929\u673a\u5668\u4eba\u6f14\u793a\u548c\u7ba1\u7406\u754c\u9762\u6f14\u793a\uff0c\u8ba9\u7528\u6237\u53ef\u4ee5\u76f4\u89c2\u5730\u4f53\u9a8c\u7cfb\u7edf\u529f\u80fd\u3002\\n\\n- \u804a\u5929\u673a\u5668\u4eba\u6f14\u793a\uff1a[https://demo.casibase.com](https://demo.casibase.com/)\\n- \u7ba1\u7406\u754c\u9762\u6f14\u793a\uff1a[https://demo-admin.casibase.com](https://demo-admin.casibase.com/)\\n\\n## Casibase \u4e0e DeepSeek \u7cfb\u5217\u6a21\u578b\u7684\u96c6\u6210\uff1a\\n\\n\u5728 Casibase \u4e2d\u4f7f\u7528 DeepSeek \u975e\u5e38\u7b80\u5355\uff0c\u901a\u8fc7\u6784\u5efa Casibase \u5e76\u8fdb\u884c\u4e00\u4e9b\u7b80\u5355\u914d\u7f6e\uff0c\u60a8\u5c31\u53ef\u4ee5\u4e0e DeepSeek R1\u3001DeepSeek V3 \u4ee5\u53ca\u963f\u91cc\u4e91\u7b49\u5176\u4ed6\u5e73\u53f0\u652f\u6301\u7684 DeepSeek \u53ca\u5176\u589e\u5f3a\u7248\u672c\u8fdb\u884c\u5bf9\u8bdd\u3002\u907f\u514d\u4e86\u672c\u5730\u90e8\u7f72\u7684\u590d\u6742\u914d\u7f6e\u3002\\n\\n### \u6b65\u9aa4\u4e00\uff1aCasibase \u73af\u5883\u90e8\u7f72\\n\\n#### 1.1 **\u90e8\u7f72 Casdoor**\\n\\n\u7531\u4e8e Casibase \u63d0\u4f9b\u7684\u5f3a\u5927\u4f01\u4e1a\u7ea7 SSO \u8ba4\u8bc1\u3001\u9274\u6743\u7b49\u529f\u80fd\u662f\u57fa\u4e8e Casdoor \u5b8c\u6210\u7684\u3002\u56e0\u6b64\uff0c\u5b89\u88c5 Casdoor \u662f\u4f7f\u7528 Casibase \u7684\u524d\u63d0\u6761\u4ef6\u3002\\n\\n_**Casdoor \u662f\u4e00\u4e2a\u5f3a\u5927\u7684\u8ba4\u8bc1\u7cfb\u7edf\uff0c\u63d0\u4f9b\u5b89\u5168\u53ef\u9760\u7684\u767b\u5f55\u4f53\u9a8c\u3002**_\\n\\n\u60a8\u53ef\u4ee5\u53c2\u8003 Casdoor \u5b98\u65b9\u6587\u6863\u5b8c\u6210 Casdoor \u73af\u5883\u90e8\u7f72\uff1a[Casdoor \u90e8\u7f72](https://casdoor.org/docs/basic/server-installation/)\\n\\n#### 1.2 **\u90e8\u7f72 Casibase**\uff1a[Casibase \u90e8\u7f72](https://casibase.org/zh/docs/basic/server-installation)\\n\\n### \u6b65\u9aa4\u4e8c\uff1aCasibase \u57fa\u7840\u914d\u7f6e\\n\\n#### 2.1 **\u914d\u7f6e Casdoor**\uff1a\\n\\n\u60a8\u9700\u8981\u5728\u5df2\u90e8\u7f72\u7684 Casdoor \u4e2d\u5b8c\u6210\u4e09\u4e2a\u6b65\u9aa4\u4ee5\u652f\u6301\u8bbf\u95ee Casibase \u7684\u7528\u6237\u5b58\u5728\uff0c\u5373\u914d\u7f6e\u7ec4\u7ec7->\u914d\u7f6e\u5e94\u7528->\u914d\u7f6e\u7528\u6237\u3002\u5177\u4f53\u64cd\u4f5c\u5982\u4e0b\uff1a\\n\\n##### 2.1.1 \u6dfb\u52a0\u7ec4\u7ec7\\n\\n\u5728 Casdoor \u7f51\u7ad9\u4e2d\u914d\u7f6e\u7ec4\u7ec7\u3002\\n\\n![\u6dfb\u52a0\u7ec4\u7ec7](/img/blog/casibase-deepSeek-guideline/add-organisations.png)\\n\\n##### 2.1.2 \u6dfb\u52a0\u5e94\u7528\\n\\n\u4e3a Casibase \u8bbe\u7f6e\\"\u5e94\u7528\\"\u3002\u60a8\u5e94\u8be5\u57fa\u4e8e\u5df2\u914d\u7f6e\u7684\u7ec4\u7ec7\u521b\u5efa\u5b83\uff0c\u8fd9\u5c06\u5728\u6dfb\u52a0\u8868\u5355\u4e2d\u4f53\u73b0\u3002\\n\\n![\u6dfb\u52a0\u5e94\u7528](/img/blog/casibase-deepSeek-guideline/add-apply.png)\\n\\n![\u6dfb\u52a0\u5e94\u7528\u8be6\u60c5](/img/blog/casibase-deepSeek-guideline/add-applications.png)\\n\\n##### 2.1.3 \u6dfb\u52a0\u7528\u6237\\n\\n\u4e3a\u521b\u5efa\u7684\u5e94\u7528\u521b\u5efa\u7528\u6237\u662f\u540e\u7eed\u767b\u5f55 Casibase \u7684\u6700\u540e\u51c6\u5907\u5de5\u4f5c\u3002\u53ea\u9700\u6309\u7167\u8868\u5355\u4e2d\u7684\u4fe1\u606f\u586b\u5199\u5373\u53ef\u3002\\n\\n![\u6dfb\u52a0\u7528\u6237](/img/blog/casibase-deepSeek-guideline/add-user.png)\\n\\n### 2.2 **\u914d\u7f6e Casibase**\uff1a\\n\\n\u901a\u8fc7\u4e0a\u8ff0\u914d\u7f6e\uff0c\u6211\u4eec\u5df2\u7ecf\u53ef\u4ee5\u8bbf\u95ee Casibase\uff0c\u63a5\u4e0b\u6765\uff0c\u5728\u767b\u5f55\u540e\uff0c\u6211\u4eec\u5c06\u4e3a AI \u804a\u5929\u8fdb\u884c\u914d\u7f6e\uff0c\u90e8\u7f72\u57fa\u4e8e\u963f\u91cc\u4e91\u5927\u6a21\u578b\u670d\u52a1\u5e73\u53f0\uff08https://help.aliyun.com/zh/model-studio/\uff09\u652f\u6301\u7684 DeepSeek r1 \u6a21\u578b\u3002\\n\\n##### 2.2.1 \u914d\u7f6e\u5b58\u50a8\u63d0\u4f9b\u5546\\n\\n\u9996\u5148\uff0c\u9700\u8981\u901a\u8fc7 Casdoor **\u914d\u7f6e\u5b58\u50a8\u63d0\u4f9b\u5546**\uff0c\u901a\u8fc7\u6dfb\u52a0\u6b64\u5b58\u50a8\u63d0\u4f9b\u5546\u53ef\u4ee5\u7528\u4e8e\u5b58\u50a8\u6570\u636e\u3002 \u9996\u5148\uff0c\u9700\u8981\u901a\u8fc7 Casdoor **\u914d\u7f6e\u5b58\u50a8\u63d0\u4f9b\u5546**\uff0c\u901a\u8fc7\u6dfb\u52a0\u6b64\u5b58\u50a8\u63d0\u4f9b\u5546\u53ef\u4ee5\u7528\u4e8e\u5b58\u50a8\u6570\u636e\u3002\u53ef\u4ee5\u901a\u8fc7\u70b9\u51fb\u9996\u9875\u4e0a\u7684\u6309\u94ae\u6dfb\u52a0\u5230 Casdoor\uff1a`Authentication-> Providers->add`\\n\\n##### 2.2.2 \u914d\u7f6e\u6a21\u578b\u63d0\u4f9b\u5546\\n\\n\u5728 Casibase \u4e2d\uff0c\u914d\u7f6e\u65b0\u7684\u6a21\u578b\u63d0\u4f9b\u5546\uff1a`\u70b9\u51fb\u9996\u9875\u9876\u90e8\u5bfc\u822a\u680f\u4e2d\u7684 Providers \u6309\u94ae->add`\u3002\\n\\n_**\u5728\u5f39\u51fa\u7684\u6dfb\u52a0\u8868\u5355\u4e2d\uff0c\u6211\u4eec\u53ef\u4ee5\u5c06 Category \u8bbe\u7f6e\u4e3a Model\uff0c\u7136\u540e\u8bbe\u7f6e\u4e00\u7ea7\u6a21\u578b\uff1a\u5982 Moonshot\u3001DeepSeek\u3001\u963f\u91cc\u4e91\u7b49\u3002\u8fd9\u91cc\u6211\u4eec\u4e0d\u76f4\u63a5\u9009\u62e9 DeepSeek \u63d0\u4f9b\u7684 AI \u6a21\u578b\u652f\u6301\uff0c\u800c\u662f\u4f7f\u7528\u963f\u91cc\u4e91\u63d0\u4f9b\u7684 DeepSeek \u652f\u6301\uff0c\u5982\u4e0b\u56fe\u6240\u793a\uff0c\u6211\u4eec\u53ef\u4ee5\u5728 Sub Type \u4e2d\u770b\u5230\u963f\u91cc\u4e91\u652f\u6301\u7684\u5404\u79cd\u5b50\u6a21\u578b\u3002**_ \u8fd9\u91cc\u6211\u4eec\u4e0d\u76f4\u63a5\u9009\u62e9 DeepSeek \u63d0\u4f9b\u7684 AI \u6a21\u578b\u652f\u6301\uff0c\u800c\u662f\u4f7f\u7528\u963f\u91cc\u4e91\u63d0\u4f9b\u7684 DeepSeek \u652f\u6301\uff0c\u5982\u4e0b\u56fe\u6240\u793a\uff0c\u6211\u4eec\u53ef\u4ee5\u5728 Sub Type \u4e2d\u770b\u5230\u963f\u91cc\u4e91\u652f\u6301\u7684\u5404\u79cd\u5b50\u6a21\u578b\u3002\\\\*\\\\*\\\\*\\n\\n![\u6dfb\u52a0\u6a21\u578b\u63d0\u4f9b\u5546](/img/blog/casibase-deepSeek-guideline/add-model-provider.png)\\n\\n##### 2.2.3 \u914d\u7f6e\u5d4c\u5165\u63d0\u4f9b\u5546\uff08\u53ef\u9009\uff09\\n\\n\u5728 2.2.1 \u548c 2.2.2 \u6dfb\u52a0\u6210\u529f\u540e\uff0c\u6211\u4eec\u53ef\u4ee5\u914d\u7f6e\u5d4c\u5165\u63d0\u4f9b\u5546\uff0c\u901a\u8fc7\u914d\u7f6e\u5d4c\u5165\u63d0\u4f9b\u5546\uff0c\u6211\u4eec\u53ef\u4ee5\u4e0e\u6211\u4eec\u5f3a\u5927\u7684\u77e5\u8bc6\u5e93\u7cfb\u7edf Casibase \u96c6\u6210\u3002\u4e0e 2.2.2 \u7c7b\u4f3c\u7684\u6b65\u9aa4\uff0c\u901a\u8fc7\uff1a`Authentication-> Providers->add` \u586b\u5199\u8868\u5355\uff08\u4f46\u8bf7\u6ce8\u610f Category \u9700\u8981\u914d\u7f6e\u4e3a Embedding\uff09\uff1a\\n\\n![Casibase\u5d4c\u5165](/img/blog/casibase-deepSeek-guideline/casibase-embedding.png)\\n\\n##### 2.2.4 \u6dfb\u52a0\u5b58\u50a8\\n\\n\u5728\u8fd9\u4e00\u6b65\u4e2d\uff0c\u6211\u4eec\u7ec4\u7ec7\u4e0a\u9762\u6dfb\u52a0\u7684\u6240\u6709\u4fe1\u606f\uff08\u5b58\u50a8\u63d0\u4f9b\u5546\u3001\u6a21\u578b\u63d0\u4f9b\u5546\u3001\u5d4c\u5165\u63d0\u4f9b\u5546\uff09\uff0c\u5728\u8868\u5355\u4e2d\u6211\u4eec\u53ef\u4ee5\u586b\u5199\u8fd9\u4e09\u9879\u5185\u5bb9\u5e76\u6700\u7ec8\u521b\u5efa\u4e00\u4e2a\u5b58\u50a8\u3002\\n\\n### \u6b65\u9aa4\u4e09\uff1a\u4f7f\u7528\u57fa\u4e8e Casibase \u548c\u963f\u91cc\u4e91\u7684 DeepSeek \u6a21\u578b\u8fdb\u884c\u804a\u5929\\n\\n![\u804a\u5929](/img/blog/casibase-deepSeek-guideline/chat.png)\\n\\n## \u7ed3\u8bba\\n\\n\u5728\u672c\u6307\u5357\u4e2d\uff0c\u6211\u4eec\u5b66\u4e60\u4e86\u5982\u4f55\u5728 Casibase \u4e2d\u4f7f\u7528 DeepSeek \u5b9e\u73b0 AI \u804a\u5929\u529f\u80fd\u3002 \u73b0\u5728\uff0c\u60a8\u53ef\u4ee5\u5728Casibase\u4e2d\u4e0e\u804a\u5929\u673a\u5668\u4eba\u5bf9\u8bdd\u4e86\u3002\u5c3d\u60c5\u4eab\u53d7\u5427\uff01\\n\\n\u66f4\u591a\u8be6\u7ec6\u4fe1\u606f\uff0c\u60a8\u53ef\u4ee5\u53c2\u8003 [Casibase \u6587\u6863](https://casibase.org/zh/docs/overview)\u3002"},{"id":"/welcome","metadata":{"permalink":"/zh/blog/welcome","editUrl":"https://github.com/casibase/casibase-website/edit/master/i18n/zh/docusaurus-plugin-content-blog/welcome.md","source":"@site/i18n/zh/docusaurus-plugin-content-blog/welcome.md","title":"\u6b22\u8fce","description":"\u6b22\u8fce\u4f7f\u7528 Casibase \u7f51\u7ad9 \uff01","date":"2025-06-10T16:06:53.100Z","formattedDate":"2025\u5e746\u670810\u65e5","tags":[{"label":"casibase","permalink":"/zh/blog/tags/casibase"}],"readingTime":0.035,"hasTruncateMarker":false,"authors":[{"name":"Casibase \u56e2\u961f","url":"https://github.com/casibase","imageURL":"https://avatars.githubusercontent.com/casibase"}],"frontMatter":{"title":"\u6b22\u8fce","author":"Casibase \u56e2\u961f","author_url":"https://github.com/casibase","author_image_url":"https://avatars.githubusercontent.com/casibase","tags":["casibase"]},"prevItem":{"title":"Casibase + DeepSeek \u96c6\u6210\u6307\u5357","permalink":"/zh/blog/casibase-deepSeek-guideline"}},"content":"\u6b22\u8fce\u4f7f\u7528 Casibase \u7f51\u7ad9 \uff01"}]}')}}]);